        <h1>Card Image with description on :hover</h1>
          <div className="card">
            <h2 className="card-title"> {el.Name} </h2>
            <img src= {el.Image}  alt="" />
            <p className="card-desc"> {el.Histoire} </p>
          </div>

          </div>
);

}

